class Solution(object):
    def twoSum(self, numbers, target):
        """
        :type numbers: List[int]
        :type target: int
        :rtype: List[int]
        """
        index1=0
        index2=1 
        while(True):
            if index2 == len(numbers):
                index1+=1
                index2 = index1+1
                continue
            
            sum= numbers[index1]+numbers[index2]
            if sum > target:
                index1+=1
                index2 = index1+1
            elif sum < target :
                index2+=1
            else :
                return [index1,index2]
            







